import React from 'react';
import { Link } from 'react-router-dom';
import "./navbar.css";
import RocketstartLogo from '../../assets/rocketstartLogo.svg';
import { useState } from 'react';
import { SignIn, SignUp } from '../../modals';

const Navbar = () => {

  const [registerModalOpen, setRegisterModalOpen] = useState(false);
  const [signInModalOpen, setSignInModalOpen] = useState(false);

  return (
    <div className='navbar__container'>
      <div className='inner__navbar'>
        <div className='navbar__logo'>
          <Link to="/" className='navbar__logo'><img src={RocketstartLogo} alt="logo" className='image__logo'></img></Link>
          <h2>Rocketstart</h2>
          <ul className='menu'>
            <li className='menu__item navbar__item-focused'>
              {/* <h3><Link to='/product'>Product</Link></h3> */}
              <h3>Product</h3>
            </li>
            <li className='menu__item'>
              <h3 ><Link to="/blog" className='navbar__item-focused'>Blog</Link></h3>
            </li>
            <li className='menu__item navbar__item-focused'>
              {/* <h3><Link to="/pricing">Pricing</Link></h3> */}
              <h3>Pricing</h3>
            </li>
            <li className='menu__item navbar__item-focused'>
              {/* <h3><Link to="/about">About</Link></h3> */}
              <h3>About</h3>
            </li>
          </ul>
        </div>
        <nav className='navbar__items'>
          <h3 className='navbar__item-focused' onClick={() => {setSignInModalOpen(true);}}>Sign In</h3>
          {/* <div className='button__container'>
            <Link to='/register'>
              <button className='navbar__button'>
                Sign Up
              </button>
            </Link>
          </div> */}
          <div className='button__container'>
            <button className='navbar__button' onClick={() => {setRegisterModalOpen(true);}}>
              Sign Up
            </button>
          </div>
        </nav>
      </div>
      {registerModalOpen && <SignUp setRegisterModalOpen={setRegisterModalOpen} />}
    </div>
  )
}

export default Navbar
